import { ReactSVG } from 'react-svg'

import './App.css';

import logo from './logo.svg';
import profilePicture  from './images/Rectangle 90.png';
import FacebookIcon  from './images/Facebook Icon.svg';
import gitHubIcon from './images/GitHub Icon.svg';
import instagramIcon from './images/Instagram Icon.svg';
import mailIcon from './images/Mail.svg';
import twitterIcon from './images/Twitter Icon.svg';
import LinkedinIcon from './images/Linked in.svg';



function App() {
  return (
    <div className="App">
      <div className="Window">
        <div className="Picture"></div>
        <h1>Laura Smith</h1>
        <h3>Frontend Developer</h3>
        <h4>laurasmith.website</h4>
        <div className="buttens">
          <button id='butn Email'> <ReactSVG src={mailIcon} color="white"/> Email</button>
          <button id='button LinkedIn'> <ReactSVG src={LinkedinIcon}/> Linkedin</button>
        </div>
        <div>
          <h2>About</h2>
          <p>I am a frontend developer with a particular interest in making things simple and automating daily tasks. I try to keep up with security and best practices, and am always looking for new things to learn.</p>
          <h2>Interests</h2>
          <p>Food expert. Music scholar. Reader. Internet fanatic. Bacon buff. Entrepreneur. Travel geek. Pop culture ninja. Coffee fanatic.</p>
        </div>
        <div className='picture'>

        </div>
        <ReactSVG src={FacebookIcon}/>
      </div>
    </div>
  );
}

export default App;
